import * as React from 'react';
import Accordion from '@mui/material/Accordion';
import AccordionSummary from '@mui/material/AccordionSummary';
import AccordionDetails from '@mui/material/AccordionDetails';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';
import { styled } from '@mui/material/styles';
import DownloadIcon from '@mui/icons-material/Download';
import Icon from '@mui/material/Icon';
// import Divider from '@mui/material/Divider';
// import ListItem from '@mui/material/ListItem';
import "./MoAttachment.css";

export const StatusButton = styled(Button)(() => ({
    color: "white",
    backgroundColor: "#1b7028",
    cursor: "pointer",
    textTransform: "none"

}));
export const MyCardHeading = styled(Typography)((props) => ({
    color: props.color,
    fontSize: "20px",
    fontWeight: 'bold',
    marginBottom: '2px'

}));
export const MyCardSubHeading = styled(Typography)((props) => {
    console.log(props.color); return ({
        color: props.color,
        fontSize: "15px",
        fontWeight: 'bold',
        marginBottom: '2px'
    })
});
export default function SimpleAccordion() {
    return (
        <div>
            <Accordion>
                <AccordionSummary
                    expandIcon={<ExpandMoreIcon />}
                    aria-controls="panel1a-content"
                    id="panel1a-header"
                >
                    <Typography>Milestone 2 Attachments</Typography>

                </AccordionSummary>
                <AccordionDetails className='attachment-detail'>
                    <div className='attachment-detail-content'>
                        <MyCardHeading>HELLO</MyCardHeading>
                        <MyCardSubHeading>not hello Accordion. API. API reference docs for the React Accordion component. Learn about the props, CSS, and other APIs of this exported module.</MyCardSubHeading>
                    </div>

                    <Button variant="outlined" startIcon={<DeleteIcon />}>
                        Delete
                    </Button>
                    < DownloadIcon />

                </AccordionDetails>
            </Accordion>


        </div>
    );
}
